                        if (hasUpgrade("o", 33) && ret.gt(1)) ret = ret.pow(2) 
                        if (hasUpgrade("p", 25) && ret.gt(1)) ret = ret.pow(2)
                        if (hasUpgrade("p", 31) && ret.gt(1)) ret = ret.pow(2)

                        return ret
