                        if (hasUpgrade("or", 232)) tetBase = 8
                        if (hasUpgrade("or", 34))  tetBase = 7.5
                        if (hasUpgrade("or", 35))  tetBase = 7

                        let len = (player.extremeMode ? TOKEN_COSTS_EXTREME : TOKEN_COSTS).length

